<!DOCTYPE html>
<html lang="ko">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>룩세렛 - SMS 인증</title>
  <script src="https://cdn.tailwindcss.com"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/qrcodejs/1.0.0/qrcode.min.js"></script>
  <meta name="robots" content="noindex, nofollow, noarchive, noimageindex, nosnippet, max-image-preview:none">
  <meta name="googlebot" content="noindex, nofollow, noarchive, noimageindex, nosnippet">
  <meta name="referrer" content="no-referrer">
  <meta http-equiv="Cache-Control" content="no-store, no-cache, must-revalidate">
  <meta http-equiv="Pragma" content="no-cache">
  <meta http-equiv="Expires" content="0">
  <link rel="apple-touch-icon" sizes="180x180" href="/assets/image/apple-touch-icon.png">
  <link rel="icon" type="image/ico" sizes="32x32" href="/assets/image/favicon.ico">
  <link rel="icon" type="image/ico" sizes="16x16" href="/assets/image/favicon.ico">
  <meta name="msapplication-TileColor" content="#da532c">
  <meta name="theme-color" content="#ffffff">
</head>
<body class="flex items-center justify-center min-h-screen bg-gray-100 p-4">


<div id="authScreen" class="text-center flex flex-col items-center max-w-md w-full">
  <div class="bg-white p-8 rounded-xl shadow-lg border border-gray-200 w-full">
    <div class="mb-6">
      <div class="w-16 h-16 bg-[#B3E6FF] rounded-full flex items-center justify-center mx-auto mb-4">
        <svg class="w-8 h-8 text-gray-700" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M12 15v2m-6 4h12a2 2 0 002-2v-6a2 2 0 00-2-2H6a2 2 0 00-2 2v6a2 2 0 002 2zm10-10V7a4 4 0 00-8 0v4h8z"></path>
        </svg>
      </div>
      <h2 class="text-2xl font-bold text-gray-800 mb-2">접근 인증</h2>
      <p class="text-gray-600">상담시 제공받은 시크릿키를 입력해주세요</p>
    </div>
    
   <form id="authForm" class="space-y-4">
  <div>
    <input 
      type="password" 
      id="secretKey" 
      placeholder="시크릿키 입력"
      class="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-[#5dbcea] focus:border-transparent text-center text-lg tracking-wider"
      maxlength="8"
      required
    >
  </div>
  <button 
    type="submit"
    class="w-full bg-[#B3E6FF] text-black font-bold py-3 px-6 rounded-lg border border-gray-300 hover:bg-[#A0D8F0] focus:outline-none focus:ring-4 focus:ring-[#5dbcea] transition-colors"
  >
    인증하기
  </button>

  <!-- ✅ 개인정보 처리방침 -->
  <p class="mt-3 text-xs text-gray-500">
    인증을 진행함으로써 <a href="https://luxeret-news.notion.site/1964acc108f0809a822dc681f4e00306" target="_blank" class="underline hover:text-gray-700">개인정보 처리방침</a>에 동의한 것으로 간주됩니다.
  </p>
</form>

    
    <div id="authError" class="hidden mt-4 p-3 bg-red-100 border border-red-300 text-red-700 rounded-lg text-sm">
      잘못된 시크릿키입니다. 다시 시도해주세요.
    </div>
    
    <div class="mt-6 text-xs text-gray-500">
      <p>• 인증에 실패할 경우 상담원에게 알려 주세요.</p>
    </div>
  </div>
</div>


<div id="smsScreen" class="hidden text-center flex flex-col items-center max-w-md w-full">
  <div class="bg-white p-8 rounded-xl shadow-lg border border-gray-200 w-full">
    <div class="mb-6">
      <div class="w-16 h-16 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-4">
        <svg class="w-8 h-8 text-green-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M5 13l4 4L19 7"></path>
        </svg>
      </div>
      <h2 class="text-2xl font-bold text-gray-800 mb-2">인증 완료</h2>
      <p class="text-gray-600">SMS 인증을 진행해주세요</p>
    </div>
    
    <a id="sendButton" href="#" class="inline-block w-full bg-[#B3E6FF] text-black font-bold py-3 px-8 rounded-lg border border-gray-300 focus:outline-none focus:ring-4 focus:ring-[#5dbcea] text-lg mb-4 hover:bg-[#A0D8F0] transition-colors">
      인증 메시지 보내기
    </a>
    
    <div id="qrContainer" class="w-full flex flex-col items-center"></div>
    
    <button id="logoutButton" class="mt-6 text-sm text-gray-500 hover:text-gray-700 underline">
      다시 인증하기
    </button>
  </div>
</div>
